function createLetterCountObj(letter, newLength, letterCountObj, index){
  
  if(index === 0) {
    letterCountObj.letter = letter;
    letterCountObj.count = newLength;
    return letterCountObj;
  } else {
    var newLetterCountObj = {};
    newLetterCountObj.letter = letter;
    newLetterCountObj.count = newLength;
  }
    if(newLength < letterCountObj.count){

      return newLetterCountObj;
    }

  return letterCountObj;
}

function eliminateOneLetter(dataTwo, letter){
      var replace = '';
      dataTwo = dataTwo.replace(new RegExp(letter, 'g'), replace);
      var lowerLetter = letter.toLowerCase();
      dataTwo = dataTwo.replace(new RegExp(lowerLetter, 'g'), replace);
      
      return dataTwo;

}